_b85alphabet = b'0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz!#$%&()*+-;<=>?@^_`{|}~'
try: b85decode = base64.b85decode
except:
    iterbytes = iter if PY3andnewer else lambda buf: (ord(byte) for byte in buf)
    def b85decode(b):
        _b85dec = [None] * 256
        for i, c in enumerate(iterbytes(_b85alphabet)):
            _b85dec[c] = i
        padding = (-len(b)) % 5
        b = b + b'~' * padding
        out = []
        packI = struct.Struct('!I').pack
        for i in range(0, len(b), 5):
            chunk = b[i:i + 5]
            acc = 0
            try:
                for c in iterbytes(chunk): acc = acc * 85 + _b85dec[c]
            except TypeError:
                for j, c in enumerate(iterbytes(chunk)):
                    if _b85dec[c] is None:
                        raise ValueError('bad base85 character at position %d' % (i + j))
                raise
            try: out.append(packI(acc))
            except struct.error: raise ValueError('base85 overflow in hunk starting at byte %d' % i)
        result = b''.join(out)
        if padding: result = result[:-padding]
        return result


