get_pip_py_text = r'''#!/usr/bin/env python
import os
import os.path
import pkgutil
import shutil
import sys
import struct
import tempfile
import re

PY2 = sys.version_info[0] == 2
PY3 = sys.version_info[0] == 3

if len(sys.argv) != 7 or sys.argv[1] != ("-theversionofpip" or "/theversionofpip") or sys.argv[3] != ("-theversionofsetuptools" or "/theversionofsetuptools") or sys.argv[5] != ("-thewebsite" or "/thewebsite"):
    os._exit(0)
version = sys.argv[2]
setuptoolsversion = sys.argv[4]
website = sys.argv[6]
if version == "LATESTVERSION":
    version = ""
if setuptoolsversion == "LATESTVERSION":
    setuptoolsversion = ""

if PY3:
    iterbytes = iter
else:
    def iterbytes(buf):
        return (ord(byte) for byte in buf)

try:
    from base64 import b85decode
except ImportError:
    _b85alphabet = (b"0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ"
                    b"abcdefghijklmnopqrstuvwxyz!#$%&()*+-;<=>?@^_`{|}~")

    def b85decode(b):
        _b85dec = [None] * 256
        for i, c in enumerate(iterbytes(_b85alphabet)):
            _b85dec[c] = i

        padding = (-len(b)) % 5
        b = b + b'~' * padding
        out = []
        packI = struct.Struct('!I').pack
        for i in range(0, len(b), 5):
            chunk = b[i:i + 5]
            acc = 0
            try:
                for c in iterbytes(chunk):
                    acc = acc * 85 + _b85dec[c]
            except TypeError:
                for j, c in enumerate(iterbytes(chunk)):
                    if _b85dec[c] is None:
                        raise ValueError(
                            'bad base85 character at position %d' % (i + j)
                        )
                raise
            try:
                out.append(packI(acc))
            except struct.error:
                raise ValueError('base85 overflow in hunk starting at byte %d'
                                 % i)

        result = b''.join(out)
        if padding:
            result = result[:-padding]
        return result


def bootstrap(tmpdir=None):
    import pip
    from pip.commands.install import InstallCommand

    class CertInstallCommand(InstallCommand):
        def parse_args(self, args):
            if not self.parser.get_default_values().cert:
                self.parser.defaults["cert"] = cert_path  # calculated below
            return super(CertInstallCommand, self).parse_args(args)

    pip.commands_dict["install"] = CertInstallCommand
    packages = ["pip"]
    if version != "":
        packages = ["pip" + "==" + version]

    try:
        import setuptools  # noqa
    except:
        if setuptoolsversion == "":
            packages += ["setuptools"]
        else:
            packages += ["setuptools" + "==" + setuptoolsversion]
    #try:
        #import wheel
    #except:
        #packages += ["wheel"]

    delete_tmpdir = False
    try:
        if tmpdir is None:
            tmpdir = tempfile.mkdtemp()
            delete_tmpdir = True
        cert_path = os.path.join(tmpdir, "cacert.pem")
        with open(cert_path, "wb") as cert:
            cert.write(pkgutil.get_data("pip._vendor.requests", "cacert.pem"))
        args = ["-i", website, "--trusted-host", "pypi.org", "--trusted-host", "files.pythonhosted.org", "--trusted-host", "mirrors.aliyun.com"]
        sys.exit(pip.main(["install", "--upgrade"] + packages + args))
    finally:
        if delete_tmpdir and tmpdir:
            shutil.rmtree(tmpdir, ignore_errors=True)


def main():
    tmpdir = None
    try:
        tmpdir = tempfile.mkdtemp()
        pip_zip = os.path.join(tmpdir, "pip.zip")
        with open(pip_zip, "wb") as fp:
            fp.write(b85decode(DATA.replace(b"\n", b"")))

        sys.path.insert(0, pip_zip)
        bootstrap(tmpdir=tmpdir)
    finally:
        if tmpdir:
            shutil.rmtree(tmpdir, ignore_errors=True)

DATA = """''' + DATA + '""".encode("ascii")' + '\nif __name__ == "__main__":\n    main()\n\n'


def creategetpipyzrpytempfile():
    global tempgetpipyzrpydirectory
    global tempgetpipyzrpydirectorypath
    try:
        tempgetpipyzrpydirectory = tempfile.TemporaryDirectory()
        tempgetpipyzrpydirectorypath = tempgetpipyzrpydirectory.name
    except:
        tempgetpipyzrpydirectorypath = tempfile.mkdtemp()
    if hasattr(builtins, 'unicode'): tempgetpipyzrpydirectorypath = unicode(tempgetpipyzrpydirectorypath)
    getpipyzrpypath = tempgetpipyzrpydirectorypath + '\\get-pip-yzr.py'
    with open(getpipyzrpypath, 'w') as getpipyzrpyfile:
        getpipyzrpyfile.write(get_pip_py_text)
    return getpipyzrpypath


def deletegetpipyzrpytempfile():
    try: tempgetpipyzrpydirectory.cleanup()
    except: shutil.rmtree(tempgetpipyzrpydirectorypath)


getpipyzrpypath = creategetpipyzrpytempfile()


try:
    rootdir = nt.getcwd().split('\\')[0] + '\\'
except: rootdir = nt.getcwd()


def run(command, print_msg=True, errorinoutput=True, wait=True, call=False, delete_r=True):
    subprocess_Popen = subprocess.Popen
    subprocess_call = subprocess.call
    PIPE = subprocess.PIPE
    if call:
        print_msg = False
        errorinoutput = False
        delete_r = False
    if not wait:
        errorinoutput = False
        PIPE = None
    if errorinoutput:
        STDOUT = subprocess.STDOUT
    else:
        STDOUT = subprocess.PIPE
    if not wait:
        p = subprocess_Popen(command, shell=True, stdout=PIPE, stderr=STDOUT, cwd=rootdir)
        return
    if call:
        code = subprocess_call(command, shell=True, stdout=PIPE, stderr=STDOUT, cwd=rootdir)
        return code
    else:
        p = subprocess_Popen(command, shell=True, stdout=PIPE, stderr=STDOUT, bufsize=-1, cwd=rootdir)
        p = io.TextIOWrapper(io.BufferedReader(io.BytesIO(p.stdout.read())), encoding='mbcs')
        text = p.read()
        p.close()
        if print_msg:
            try:
                print2(text)
            except:
                pass
        if delete_r:
            text = text.replace('\r', '')
        return text


def isfile(_file):
    try:
        st = nt.stat(_file)
    except Exception:
        return False
    if st.st_mode & 0xf000 == 0x8000:
        return True
    else:
        return False


