def replaceBackslashesInFrontOfDoubleQuotationMarksWithDouble(s):
    pattern = r'(\\*)(?=")'
    def replacement(match):
        backslashes = match.group(1)
        n = len(backslashes)
        return '\\' * (2 * n)
    result = re.sub(pattern, replacement, s)
    return result


def splitCommand(command):
    CommandLineToArgvW = ctypes.windll.shell32.CommandLineToArgvW
    CommandLineToArgvW.restype = ctypes.POINTER(ctypes.c_wchar_p)
    lpCmdLine = ctypes.c_int()
    args = CommandLineToArgvW(u'' + command, ctypes.byref(lpCmdLine))
    res = args[:lpCmdLine.value]
    LocalFree = ctypes.windll.kernel32.LocalFree
    LocalFree.argtypes = [ctypes.c_void_p]
    LocalFree.restype = ctypes.c_void_p
    LocalFree(args)
    return res


def getOldPipCommand(args=''): return '"import sys; import pip; sys.exit(pip.main([\'%s\']))"' % '\', \''.join([replaceBackslashesInFrontOfDoubleQuotationMarksWithDouble(i).replace('\\', '\\\\').replace('"', '\\"').replace('\'', '\\\'') for i in splitCommand('pip ' + args)[1:]])


def getSaferCommand(args=''): return ' '.join([re.sub('(?<!^)"(?!$)', '\\"', replaceBackslashesInFrontOfDoubleQuotationMarksWithDouble('"%s"' % i)) for i in splitCommand('pip ' + args)[1:]])


class PythonInRegistry(object):
    def __init__(self):
        self.list1, self.list2 = [], []
    def getExePathByPythonPath(self, path):
        try: return self.list2[self.list1.index(path)]
        except:
            path = path.replace('\\', '/').replace('//', '/').replace('/', '\\')
            return path + ('\\pypy.exe' if isfile(path + '\\pypy.exe') else '\\python.exe')


PythonInRegistry = PythonInRegistry()


class QSubToMainThread(QObject):
    signal = Signal(object)


class setPythonVersion(threading.Thread):
    def __init__(self, path, signal):
        self.path = path
        self.signal = signal
        threading.Thread.__init__(self)
    def run(self):
        self.signal.emit([window.selectPython_pushButton.setEnabled, [False]])
        self.signal.emit([window.selectPython_progressBar.setFormat, [loadingtext]])
        self.signal.emit([window.selectPython_progressBar.setProperty, ['value', 100]])
        path = self.path
        pathisvalid, pipinstalled = False, False
        if isfile(path):
            self.signal.emit([print2, ['----------------[%s]----------------' % ':'.join(getcurrenttime())]])
            self.signal.emit([print2, ['[%s]    %s' % (processingcolontext, '"' + path + '" -c "import nt; nt._exit(0)"' + ' & ' + '"' + path + '" -V' + ' & ' + '"' + path + '" -m pip -V')]])
            self.signal.emit([print2, ['\n']])
            pathisvalid = not run('"' + path + '" -c "import nt; nt._exit(0)"', False, False, True, True)
            if pathisvalid:
                command = run('"' + path + '" -V', False)
                versionstring = ''.join(command.strip().split('\n')[0].split(' ')[1:2])
                try: version = tuple(map(int, re.split('[a-zA-Z]+|[.]', versionstring)[0:2]))
                except: version = (0, 0)
                command = run(('"' + path + '" -c "import sys; import pip; sys.exit(pip.main([\'-V\']))"') if (0, 0) < version <= (2, 6) else ('"' + path + '" -m pip -V'), False, False, True, True)
                pipinstalled = not command
        self.signal.emit([print2, ['----------------[%s]----------------' % ':'.join(getcurrenttime())]])
        self.signal.emit([window.selectPython_progressBar.setFormat, [readytext]])
        self.signal.emit([window.selectPython_progressBar.setProperty, ['value', 0]])
        if pathisvalid:
            window.pythonPath = path
            window.pythonVersion = version
            window.pipInstalled = pipinstalled
            self.signal.emit([print2, ['[%s]    %s' % (infotext, 'Python %s "%s" (pip is %s)' % (versionstring, window.pythonPath, 'installed' if pipinstalled else 'not installed'))]])
            if pipinstalled: refreshInstalledModulesList(path)
            self.signal.emit([window.switchPageTo, [2 if pipinstalled else 1]])
        else:
            self.signal.emit([print2, ['[%s]    %s' % (errortext, thepathisinvalidtext)]])
            self.signal.emit([window.dialogue.showWarning, [thepathisinvalidtext, errortext]])
        self.signal.emit([window.selectPython_pushButton.setEnabled, [True]])
        self.signal.emit([print2, ['\n']])


class installPip(threading.Thread):
    def __init__(self, path, version, setuptoolsversion, index, signal):
        self.path = path
        self.version = version
        self.setuptoolsversion = setuptoolsversion
        self.index = index
        self.signal = signal
        threading.Thread.__init__(self)
    def run(self):
        self.signal.emit([print2, ['----------------[%s]----------------' % ':'.join(getcurrenttime())]])
        path, version, setuptoolsversion, index = self.path, self.version, self.setuptoolsversion, self.index
        self.signal.emit([window.configurePip_pushButton.setEnabled, [False]])
        self.signal.emit([window.configurePip_progressBar.setFormat, [processingtext]])
        self.signal.emit([window.configurePip_progressBar.setProperty, ['value', 100]])
        commandstring = '"%s" "%s" -theversionofpip %s -theversionofsetuptools %s -thewebsite %s' % (path, getpipyzrpypath, version, setuptoolsversion, index)
        self.signal.emit([print2, ['[%s]    %s' % (processingcolontext, commandstring)]])
        self.signal.emit([print2, ['\n']])
        command = run(commandstring, False)
        pipversioncommand = ('"' + path + '" -c "import sys; import pip; sys.exit(pip.main([\'-V\']))"') if (0, 0) < window.pythonVersion <= (2, 6) else ('"' + path + '" -m pip -V')
        if 'Successfully installed' in command:
            pipinstalled = not run(pipversioncommand, False, False, True, True)
            flashtaskbarbutton(window.hwnd())
