class listInstalledModules(threading.Thread):
    def __init__(self, path, signal):
        self.path = path
        self.signal = signal
        threading.Thread.__init__(self)
    def run(self):
        path = self.path
        self.signal.emit([window.manageModules_tableWidget.setEnabled, [False]])
        self.signal.emit([window.manageModules_pushButton2.setEnabled, [False]])
        commandstring = ('"%s" -c "import sys; import pip; sys.exit(pip.main([\'list\']))"' if (0, 0) < window.pythonVersion <= (2, 6) else '"%s" -m pip list') % path
        command = run(commandstring, False, False)
        modulelistbase = re.sub(' +', ' ', re.sub(' +\n', '\n', re.sub('Package +Version\n', '', re.sub('-+ +-+\n', '', command.replace('(', '').replace(')', '')))))
