def checkpythoninregistry():
    templist1 = []
    templist2 = []
    templist3 = []
    num = 0
    try:
        pythoncorekey = winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, 'SOFTWARE\\Python\\PythonCore')
        try:
            while True:
                enumkey = winreg.EnumKey(pythoncorekey, num)
                try:
                    try:
                        value1 = winreg.QueryValueEx(
                            winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, 'SOFTWARE\\Python\\PythonCore\\' + enumkey),
                            'SysVersion')[0]
                    except: value1 = enumkey
                    if value1[::-1][:3][::-1] in ['-32', '-64']: value1 = value1[:len(value1)-3]
                    installpathkey = winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, 'SOFTWARE\\Python\\PythonCore\\' + enumkey + '\\InstallPath')
                    value2 = winreg.QueryValueEx(installpathkey, '')[0]
                    try: value3 = winreg.QueryValueEx(installpathkey, 'ExecutablePath')[0]
                    except: value3 = value2 + 'python.exe'
                    templist1.append(value1)
                    templist2.append(value2)
                    templist3.append(value3)
                except: pass
                num += 1
        except: pass
    except: pass
    num = 0
    try:
        pythoncorekey = winreg.OpenKey(winreg.HKEY_CURRENT_USER, 'Software\\Python\\PythonCore')
        try:
            while True:
                enumkey = winreg.EnumKey(pythoncorekey, num)
                try:
                    try:
                        value1 = winreg.QueryValueEx(
                            winreg.OpenKey(winreg.HKEY_CURRENT_USER, 'Software\\Python\\PythonCore\\' + enumkey),
                            'SysVersion')[0]
                    except: value1 = enumkey
                    if value1[::-1][:3][::-1] in ['-32', '-64']: value1 = value1[:len(value1)-3]
                    installpathkey = winreg.OpenKey(winreg.HKEY_CURRENT_USER, 'Software\\Python\\PythonCore\\' + enumkey + '\\InstallPath')
                    value2 = winreg.QueryValueEx(installpathkey, '')[0]
                    try: value3 = winreg.QueryValueEx(installpathkey, 'ExecutablePath')[0]
                    except: value3 = value2 + 'python.exe'
                    templist1.append(value1)
                    templist2.append(value2)
                    templist3.append(value3)
                except: pass
                num += 1
        except: pass
    except: pass
    try:
        templist1, templist2, templist3 = [list(i) for i in zip(*sorted(list(zip([tuple([int(j) for j in k.split('.')]) for k in templist1], templist2, templist3)), key=lambda x: x[0], reverse=True))]
        templist1 = ['.'.join([str(j) for j in i]) for i in templist1]
    except: pass
    templist1.append(customtext)
    templist2.append('')
    templist3.append('')
    PythonInRegistry.list1, PythonInRegistry.list2 = templist2, templist3
    return templist1, templist2, templist3


