        self.setStyleSheet(self.qss % (self.__textclr, 127, 127, 127))
        self.a1, self.b1, self.c1, self.a2, self.b2, self.c2 = [random.randint(0, 255) for i in range(6)]
        self.state = 1
        self.mincv = 0
        self.maxcv = 255
